import * as React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import ClientsTableRow from "./ClientsTableRow";

function createData(name, status, isEnrolled, date, contact) {
  return { name, status, isEnrolled, date, contact };
}

const rows = [
  createData(
    "John Max",
    "Information Session",
    "No",
    "2023-01-02",
    "john.max@yahoo.com"
  ),
  createData(
    "Lily Mon",
    "Application Approved",
    "Yes",
    "2023-02-03",
    "301-233-1234"
  ),
];

export default function BasicTable() {
  return (
    <Box>
      <Button>Add</Button>
      <TableContainer component={Paper}>
        <Table
          sx={{ minWidth: 650, textAlign: "center" }}
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Is Enrolled?</TableCell>
              <TableCell>Latest Updated Date</TableCell>
              <TableCell>Contact</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <ClientsTableRow client={row} />
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}
